(1, 1, 'Vedha Sarovar Venture', 1, '<p><strong>Project Features:</strong></p>\r\n\r\n<ol>\r\n	<li>100 % Clear title</li>\r\n	<li>Gated layout, fully fenced and secured (HMDA Approved)</li>\r\n	<li>50,40 and 33 feet roads.</li>\r\n	<li>Grand entrance arch</li>\r\n	<li>Under ground drainage</li>\r\n	<li>Ample water with overhead water tank</li>\r\n	<li>Avenue plantations</li>\r\n	<li>Parks</li>\r\n	<li>Electricity with street lights</li>\r\n	<li>The entire layout is designed as per Vaastu</li>\r\n</ol>\r\n', '17.4016706585805', '78.470432683825', '', 'uploads/ventures/1573204075vedhasarovar.png', 'Upcoming', 'https://goo.gl/maps/PpErKnRjqbXbiL3Q6', '2019-10-28 11:21:24', 'vedha-sarovar-venture', 1, '1654501045Vanadhara-New.pdf', 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d30450.922961339253!2d78.384517!3d17.442218!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xbdecea5e77a8ebae!2sNext%20Page%20Technologies%20Pvt.Ltd.!5e0!3m2!1sen!2sin!4v1654500975969!5m2!1sen!2sin', '<p><strong>Project Highlights:</strong></p>\r\n\r\n<ol>\r\n	<li>45 mins drive from the Rajiv Hitech City.</li>\r\n	<li>7 mins drive to ORR &ndash; IT SEZ.</li>\r\n	<li>15 mins drive tO Bus &amp; Railway station, Hospital, Police station, Schools &amp; Colleges etc. Shadnagar has been taken into new Ranga Reddy district and Cyberabad Police limits have been extended till shadnagar.</li>\r\n	<li>Nearby proposed park</li>\r\n	<li>Near proposed peripheral ring road.</li>\r\n	<li>Near Infosys, Accenture &amp; Microsoft etc.</li>\r\n	<li>Near Hyderabad &ndash; Bangalore NH-9 Highway.</li>\r\n	<li>Hyderabad &ndash; Srisailam Railway has been sanctioned the Double track Electrical lines for faster commuting between two major metropolitan cities in south India.</li>\r\n</ol>\r\n', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<caption>\r\n	<h3><strong>Statement of Area</strong></h3>\r\n	</caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"vertical-align:top\"><strong>&nbsp; Net Layout area</strong></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"vertical-align:top\">&nbsp; Ac.48.683</td>\r\n					</tr>\r\n					<tr>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Plot Area(55.12%)</strong></td>\r\n			<td>&nbsp; Ac.13.055</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Site reserved for public purpose(10.00%)</strong></td>\r\n			<td>&nbsp; Ac.2.368</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Roads Area (34.87%)</strong></td>\r\n			<td>&nbsp; Ac.8.26</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<caption>\r\n	<p>&nbsp;</p>\r\n\r\n	<h3><strong>HMDA&nbsp;DETAILS</strong></h3>\r\n	</caption>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>&nbsp; C.NO.</strong></td>\r\n			<td>&nbsp; 2676/2020/H</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Ref.No.Lr.No.</strong></td>\r\n			<td>&nbsp; 29/2020/HMDA/MEDCHL</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Date</strong></td>\r\n			<td>&nbsp; 06/06/2020</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; Of DTCPO</strong></td>\r\n			<td>&nbsp; HYDERABAD</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; CONFIRMED T.L.P No</strong></td>\r\n			<td>&nbsp; 212/2020/H</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(2, 1, 'Vedha Kailash Ventures', 1, '<p><samp><code>Vedha Ventures is an integrated real estate developer focused on premium developments across India with its head quarters in Hyderabad. The company aspires to be among top real estate companies. We have completed several landmark projects and is currently developing significant projects across India. </code></samp></p>\r\n\r\n<p><samp><code>Vedha Ventures brand reflects trade attributes of impeccable professionalism and bench mark of quality. Every individual who is a part of Vedha Ventures strives to ensure quality in the areas of design, project management, execution and infrastructure development. </code></samp></p>\r\n\r\n<p><samp><code>We aim to build inspirational development for our customers with distinctive design, quality construction and finishing. Everything we do is aimed at delighting our customers and ensuring their loyalty over the long term, surpassing customer&#39;s expectations.</code></samp></p>\r\n\r\n<p><big><strong><samp><code>Venture Features</code></samp></strong></big></p>\r\n\r\n<ul>\r\n	<li>DTCP APPROVED Layout</li>\r\n	<li>100&prime; Road Facing Venture</li>\r\n	<li>Gated Community Developments</li>\r\n	<li>Elegant Entrance Plaza</li>\r\n	<li>40&prime; &amp; 30&prime; B.T Roads with Kerb Stones</li>\r\n	<li>Underground Drainage System</li>\r\n	<li>Water Lines to every Plot &amp; Overhead TankElectric Lines with Unique Street Lights</li>\r\n	<li>Electric Lines with Unique Street Lights</li>\r\n	<li>Avenue Plantation &amp; Beautiful Landscape Park</li>\r\n	<li>Children&rsquo;s Play Area</li>\r\n</ul>\r\n\r\n<h3><strong>Location Proximity</strong></h3>\r\n\r\n<ul>\r\n	<li>Amazon</li>\r\n	<li>L.V. Prasad Eye Institue</li>\r\n	<li>P&amp;G, Natco Pharma</li>\r\n	<li>Johnson &amp; Johnson</li>\r\n	<li>JIMS Hospital</li>\r\n	<li>Electronic City</li>\r\n	<li>Inside RRR</li>\r\n	<li>JP Dargah &ndash; 05KM</li>\r\n	<li>Shadnagar &ndash; 10KM</li>\r\n	<li>Maheshwaram &ndash; 12KM</li>\r\n	<li>ORR &ndash; 15KM</li>\r\n	<li>International Airport &ndash; 15KM</li>\r\n</ul>\r\n', '17.4016706', '78.470432', '', 'uploads/ventures/1573204089vedhaKailash.png', 'Ongoing', 'https://goo.gl/maps/PpErKnRjqbXbiL3Q6', '2019-10-28 11:39:43', 'vedha-kailash-ventures', 3, NULL, NULL, NULL, NULL),
